import React from "react";
import NoticeCard from "./cards/NoticeCard";

function Notice(props) {
  let data = props.notice;
  console.log(data);

  return (data.map = (d) => {
    return <NoticeCard id={d.id} question={d.question} answer={d.answer} />;
  });
}

export default Notice;
